import React from 'react';

import './title.css';

const Title = () => {
    return(
        <div className="title about-service mt-5 mb-5">
            <h1 className="text-center mb-5"><span className="brand-style">ПИКЧА.Photoboard </span>
                – это место встреч<br/> для фотографов и фотомоделей</h1>
        </div>
    )
};

export default Title;
